import React, { useState, useEffect } from 'react';
import { useParams, useNavigate } from 'react-router-dom';
import { getContracts } from '../services/ContractService';

const ContractDetails = () => {
  const { id } = useParams();
  const navigate = useNavigate();
  const [contract, setContract] = useState(null);
  const [loading, setLoading] = useState(true);
  const [error, setError] = useState('');

  useEffect(() => {
    const fetchContract = async () => {
      try {
        const data = await getContracts(id);
        setContract(data);
      } catch (err) {
        setError(err.message);
      } finally {
        setLoading(false);
      }
    };

    fetchContract();
  }, [id]);

  if (loading) return <div className="text-center py-8">Загрузка...</div>;
  if (error) return <div className="text-center py-8 text-red-600">{error}</div>;
  if (!contract) return null;

  return (
    <div className="max-w-4xl mx-auto py-8 px-4">
      <div className="flex justify-between items-center mb-6">
        <h1 className="text-2xl font-bold">Контракт #{contract.id}</h1>
        <button
          onClick={() => navigate(-1)}
          className="bg-gray-500 hover:bg-gray-600 text-white px-4 py-2 rounded"
        >
          Назад
        </button>
      </div>

      <div className="bg-white rounded-lg shadow p-6 mb-6">
        <div className="grid grid-cols-1 md:grid-cols-2 gap-6">
          <div>
            <h2 className="text-xl font-semibold mb-4">Основная информация</h2>
            <div className="space-y-3">
              <div>
                <p className="font-medium">Пользователь:</p>
                <p>{contract.first_name} {contract.last_name}</p>
              </div>
              <div>
                <p className="font-medium">Статус:</p>
                <p className={`inline-block px-2 py-1 text-xs rounded-full ${
                  contract.status === 'active' ? 'bg-green-100 text-green-800' :
                  contract.status === 'pending' ? 'bg-yellow-100 text-yellow-800' :
                  'bg-red-100 text-red-800'
                }`}>
                  {contract.status === 'active' ? 'Активен' :
                   contract.status === 'pending' ? 'Ожидание' : 'Неактивен'}
                </p>
              </div>
              <div>
                <p className="font-medium">Дата создания:</p>
                <p>{new Date(contract.created_at).toLocaleDateString()}</p>
              </div>
            </div>
          </div>

          <div>
            <h2 className="text-xl font-semibold mb-4">Финансовая информация</h2>
            <div className="space-y-3">
              <div>
                <p className="font-medium">Ежемесячный платеж:</p>
                <p>{contract.monthly_payment} ₽</p>
              </div>
              <div>
                <p className="font-medium">Разовый платеж:</p>
                <p>{contract.one_time_payment} ₽</p>
              </div>
              <div>
                <p className="font-medium">Общая сумма:</p>
                <p>{contract.total_payment} ₽</p>
              </div>
            </div>
          </div>
        </div>

        <div className="mt-6">
          <h2 className="text-xl font-semibold mb-2">Описание</h2>
          <p className="whitespace-pre-line">{contract.description || 'Нет описания'}</p>
        </div>
      </div>
    </div>
  );
};

export default ContractDetails;
